import Navbar from '../components/Navbar.js';
import Hero from '../components/Hero.js';

function Inicio (){
    return(
     <>
        <Navbar />
        <Hero 
        cName="hero-container"
        title="Reserva con confianza, descansa con tranquilidad"
        />
     </>   
    )
}

export default Inicio;
